import React from 'react'
import { Drawer,AppBar,
		 Toolbar,Divider,
		  Box,IconButton,
		  Typography,CssBaseline,
		  Hidden,Container,
		  Badge } from '@material-ui/core'

import { Menu,Close,
		 ShoppingCart,Search } from "@material-ui/icons";
import './style.css'

export class index extends React.Component {
	constructor(props){
    super(props);
    this.state={
    		mobileOpen: false,
        };

    };

    handleDrawerToggle =() =>{
    	this.setState({mobileOpen: !this.state.mobileOpen})
    	console.log('ok')
  	};

	render() {
		return (
			<>
				<AppBar position="fixed" className="bar">
					<Container>
				        <Toolbar>
				        	<div style={{display: 'flex', alignItems: 'center'}}>
					           <IconButton
					            aria-label="open drawer"
					            edge="start"
					            onClick={this.handleDrawerToggle}
					           >
					            <Menu />
					           </IconButton>
					           <Typography variant="h6" noWrap component="div">
					            	Shop
					           </Typography>
					        </div>
					        <div className="basket-wrapper">
					        	<div className="input-search">
					            	<Search className="search"/>
					            	<input type='text' className="custom-input" placeholder='Search products ...'/>
					            </div>
				                <IconButton
				                  aria-label="Show basket contents"
				                  color="inherit"
				                >
				                  <Badge badgeContent={2} color="secondary">
				                    <ShoppingCart className="custom-basket" />
				                  </Badge>
				                </IconButton>
				            </div>
				        </Toolbar>
			        </Container>
		        </AppBar>
		        <nav className="drawer">
		        	<Hidden smUp implementation="css">
		        		<Drawer
				            variant="temporary"
				            open={this.state.mobileOpen}
	            			onClose={this.handleDrawerToggle}

				            ModalProps={{
				              keepMounted: true, // Better open performance on mobile.
				            }}
				          >
			            <IconButton onClick={this.handleDrawerToggle} style={{marginRight: 0, marginLeft: 'auto'}}>
			              <Close/>
			            </IconButton>
			          </Drawer>
		        	</Hidden>
		        </nav>
			</>
		)
	}
}

export default index
